import React from 'react';
import './Navbar.css'
import logo from '../Assets/logo2.png'
import cartImg from '../Assets/cartLogo.png'
const Navbar = () => {
  return (
    <div className='navbar'>
      <div className="nav-log">
        <img src={logo} alt="" />
        <p>AYURCARE</p>
      </div>
      <ul className="nav-menu"></ul>
      <li></li>
    </div>
  );
}

export default Navbar;
